import "./Hstyles.css";

function Hero(props){
    return(
        <>
        <div className={props.cName}>
            <img alt="HeroImg" src={props.heroImg}/>

            <div className="hero-text">
                <h1>{props.title}</h1>
                <p>{props.text}</p>
                <a href={props.url} className={props.b}>Donate Now</a>
            </div>
        </div>
        </>
    )
}

export default Hero;
